package old.medium

import kotlin.math.max

class Problem3 {
    fun lengthOfLongestSubstring(s: String): Int {
        if (s.isEmpty()) {
            return 0
        } else if (s.length == 1) {
            return 1
        }
        var max = 0
        val data = hashMapOf<Char, Int?>()
        var left = 0
        var i = 0
        while (i < s.length) {
            val c = s[i]
            if (data[c] == null) {
                // check len and update
                data[c] = i
            } else {
                left = max(left, data[c]!! + 1)
                data[c] = i
            }
            val temp = i - left + 1
            if (temp > max) {
                max = temp
            }
            i++
        }
        return max
    }
}

